import React from "react";
import AutoplaySlider from "react-awesome-slider/hoc/autoplay";
import AwesomeSliderStyles from "react-awesome-slider/src/styled/fold-out-animation.scss";
import slider1 from "../assets/slide1.jpeg";
import slider2 from "../assets/slide2.jpeg";
import slider3 from "../assets/slide3.jpeg";
import slider4 from "../assets/slide4.jpeg";
import slider5 from "../assets/slide5.jpeg";

const Sliders = () => {
  return (
    <AutoplaySlider
      play={true}
      cancelOnInteraction={false}
      interval={6000}
      cssModule={AwesomeSliderStyles}
    >
      <div data-src={slider1} />
      <div data-src="/path/to/image-1.jpg" />
      <div data-src="/path/to/image-2.jpg" />
      <div data-src="/path/to/image-3.jpg" />
      <div data-src="/path/to/image-3.jpg" />
    </AutoplaySlider>
  );
};

export default Sliders;
